var expect = chai.expect;

var animatedSource = 'http://i.imgur.com/ylvgI.gif';
var stoppedSource = 'data:image/png;base64,';

var setupGif = function () {
    var testElement = document.getElementById('temp');

    img = createImage();
    testElement.appendChild(img);

    return img;
}

function eventFire(el, etype){
    if (el.fireEvent) {
        el.fireEvent('on' + etype);
    } else {
    var evObj = document.createEvent('Events');
        evObj.initEvent(etype, true, false);
        el.dispatchEvent(evObj);
    }
}

var createImage = function () {
    var img = document.createElement("img");
    img.setAttribute('src', animatedSource);
    return img;
}

describe('gif-stop', function () {
    this.timeout(15000);
    describe('.gifStop', function () {
        it( 'should be animated initially', function () {
            var img = setupGif();
            var gifs = gifStop(img);

            expect(img.src).to.equal(animatedSource);
        });

        it( 'should work with a nodeList', function (done) {
            var fragment = document.createDocumentFragment()
            fragment.appendChild(setupGif())
            fragment.appendChild(setupGif())
            var counter = 0;
            var gifs = gifStop(fragment.childNodes, {
                onReady: function () {
                    counter++;
                    if(counter == 2) {
                        expect(counter).to.equal(2);
                        done();
                    }
                }
            });
        });

        it( 'should be stopped on ready', function (done) {
            var img = setupGif();
            var gifs = gifStop(img, {
                onReady: function(gif){
                    expect(img.src).to.equal(stoppedSource);
                    done();
                }
            });
        });

        it( 'should be animated on ready when play is called immediately', function (done) {
            var img = setupGif();
            var gifs = gifStop(img, {
                onReady: function(gif){
                    expect(img.src).to.equal(animatedSource);
                    done();
                }
            });

            gifs.play()
        });

        it( 'should animate when play is called', function (done) {
            var img = setupGif();
            var gifs = gifStop(img, {
                onReady: function(gif){
                    gif.play()
                    expect(gif.img.src).to.equal(animatedSource);
                    done();
                }
            });
        });

        it( 'should stop when stop is called', function (done) {
            var img = setupGif();
            gifs = gifStop(img, {
                onReady: function(gif){
                    gif.play()
                    gif.stop()
                    expect(img.src).to.equal(stoppedSource);
                    done();
                }
            });
        });

        describe('playOn options', function () {
            describe('click events', function () {
                it( 'should play when clicked', function (done) {
                    var img = setupGif();
                    gifs = gifStop(img, {
                        playOn: 'click',
                        onReady: function(gif){
                            eventFire(img, 'click')
                            expect(gif.img.src).to.equal(animatedSource);
                            done();
                        }
                    });
                });

                it( 'should stop when clicked', function (done) {
                    var img = setupGif();
                    gifs = gifStop(img, {
                        playOn: 'click',
                        onReady: function(gif){
                            gif.play()
                            eventFire(img, 'click')
                            expect(gif.img.src).to.equal(stoppedSource);
                            done();
                        }
                    });
                });
            });

            describe('mouse events', function () {
                it( 'should play on mouse enter', function (done) {
                    var img = setupGif();
                    gifs = gifStop(img, {
                        playOn: 'hover',
                        onReady: function(gif){
                            eventFire(img, 'mouseenter')
                            expect(gif.img.src).to.equal(animatedSource);
                            done();
                        }
                    });
                });

                it( 'should stop when on mouse out', function (done) {
                    var img = setupGif();
                    gifs = gifStop(img, {
                        playOn: 'hover',
                        onReady: function(gif){
                            gif.play()
                            eventFire(img, 'mouseleave')
                            expect(gif.img.src).to.equal(stoppedSource);
                            done();
                        }
                    });
                });
            });
        });
    });
});